style.css:
@-moz-document url("https://www.puzzle-binairo.com/") {
.task-cell.cell-1,
	.cell.selectable.cell-1 {
  	background-color: darkred;
		border-color: darkred;
	}

	.task-cell.cell-0,
	.cell.selectable.cell-0 {
  	background-color: cadetblue;
		border-color: cadetblue;
	}
  
	span.game-style.game-style-on.cell-1,
	.btn.cell-1 .game-style {
 		background-color: darkred;
	}

	span.game-style.game-style-x.cell-0,
	.btn.cell-0 .game-style {
		background-color: cadetblue;
	}
}
